local weapon_icons = {}
for key, val in pairs(svg_weapons) do
	local imgRGBA, imgWidth, imgHeight = common.RasterizeSVG(val, 0.5)
	table.insert(weapon_icons, {["weapon_name"] = key, ["texture"] = draw.CreateTexture(imgRGBA, imgWidth, imgHeight), ["width"] = imgWidth, ["height"] = imgHeight})
end

-- actual script
local kills = {}

client.AllowListener("player_death")
client.AllowListener("round_start")
client.AllowListener("round_announce_match_start")
client.AllowListener("client_disconnect")
callbacks.Register("FireGameEvent", function(event)
												 
	local name = event:GetName()

	if (name == "round_start" or name == "client_disconnect" or name == "round_announce_match_start") then
		kills = {}
		return
	end

	if (name == "player_death") then
		local attacker = entities.GetByUserID(event:GetInt("attacker"))
		local victim = entities.GetByUserID(event:GetInt("userid"))

		if (attacker == nil or victim == nil) then
			return
		end

		if (attacker:GetName() == nil or attacker:GetTeamNumber() == nil) then
			return
		end

		if (victim:GetName() == nil or victim:GetTeamNumber() == nil) then
			return
		end

		if (idk:GetValue() and victim:GetIndex() == client.GetLocalPlayerIndex()) then
			kills = {}
			return
		end

		if ( not shitboxlocal:GetValue() and attacker:GetIndex() == client.GetLocalPlayerIndex()) then
			return
		end

		if (not shitboxteam:GetValue() and attacker:GetTeamNumber() == entities.GetLocalPlayer():GetTeamNumber() and attacker:GetIndex() ~= client.GetLocalPlayerIndex()) then
			return
		end

		if (not shitboxenemy:GetValue() and attacker:GetTeamNumber() ~= entities.GetLocalPlayer():GetTeamNumber()) then
			return
		end

		local assister_name = client.GetPlayerNameByUserID(event:GetInt("assister"))
		local assisted_flash = not (event:GetInt("assistedflash") == 0 and true or false)
		local weapon_name = event:GetString("weapon")
		local penetrated = not (event:GetInt("penetrated") == 0 and true or false)
		local headshot = not (event:GetInt("headshot") == 0 and true or false)

		table.insert(kills, {attacker, assister_name, assisted_flash, weapon_name, penetrated, headshot, victim, globals.CurTime()})
	end
end)

local bg_colour = {0, 0, 0, 213}
local border_colour = {128, 0, 0, 255}
local ct_colour = {79, 158, 222, 255}
local tt_colour = {199, 162, 71, 255}




local render = {};

render.outline = function( x, y, w, h, col )
	draw.Color( col[1], col[2], col[3], col[4] );
	draw.OutlinedRect( x, y, x + w, y + h );
end

render.rect = function( x, y, w, h, col )
	draw.Color( col[1], col[2], col[3], col[4] );
	draw.FilledRect( x, y, x + w, y + h );
end

render.rect2 = function( x, y, w, h )
	draw.FilledRect( x, y, x + w, y + h );
end

render.gradient = function( x, y, w, h, col1, col2, is_vertical )
	render.rect( x, y, w, h, col1 );

	local r, g, b = col2[1], col2[2], col2[3];

	if is_vertical then
		for i = 1, h do
			local a = i / h * 255;
			render.rect( x, y + i, w, 1, { r, g, b, a } );
		end
	else
		for i = 1, w do
			local a = i / w * 255;
			render.rect( x + i, y, 1, h, { r, g, b, a } );
		end
	end
end


local function hsvToRgb(h, s, v)
	local r, g, b

	local i = math.floor(h * 6);
	local f = h * 6 - i;
	local p = v * (1 - s);
	local q = v * (1 - f * s);
	local t = v * (1 - (1 - f) * s);

	i = i % 6

	if i == 0 then r, g, b = v, t, p
	elseif i == 1 then r, g, b = q, v, p
	elseif i == 2 then r, g, b = p, v, t
	elseif i == 3 then r, g, b = p, q, v
	elseif i == 4 then r, g, b = t, p, v
	elseif i == 5 then r, g, b = v, p, q
	end

	return r * 255, g * 255, b * 255
  end


  local function DrawRainbowRectOutline( frequency, x, y, w, h, a )


	for i = x - 2, x + w + 4 do
        
        local rounding = 0

        if i == x - 2 then rounding = 3
        elseif  i == x - 1 then rounding = 2
        elseif  i == x then rounding = 1 
        elseif  i == x + w + 4 then rounding = 3
        elseif  i == x + w + 3 then rounding = 2
        elseif  i == x + w + 2 then rounding = 1 end

        local r, g, b
		r, g, b = hsvToRgb((globals.TickCount() - i) * frequency  % 360 / 360, 1, 1);
		draw.Color( r, g, b, a )
		draw.Line( i, y - 3 + rounding , i, y + h + 3 - rounding )
	end

end

local charset = {}
for i = 48,  57 do table.insert(charset, string.char(i)) end
for i = 65,  90 do table.insert(charset, string.char(i)) end

function randomstring(length)

  if length > 0 then
    return randomstring(length - 1) .. charset[math.random(1, #charset)]
  else
    return ""
  end
end

