callbacks.Register("Draw", function()
	if (not entities.GetLocalPlayer() or entities.GetLocalPlayer():IsAlive() == nil or engine.GetMapName() == nil or engine.GetServerIP() == nil) then
		return
	end

	local cvar = "cl_drawhud_force_deathnotices"
	if (client.GetConVar(cvar) ~= -1) then
		client.SetConVar(cvar, -1, true)
	end

	draw.SetFont(dcf)
	local screen_width, screen_height = draw.GetScreenSize()

	local start_x, start_y = screen_width, screen_height * initial_height_modifier
	local notice_height = 25
	local y_offset = 6

	-- iterate over data collected by FireGameEvent
	for index, val in pairs(kills) do
		-- reset texture
		draw.SetTexture(nil)

		-- adjust death notice position based on index
		if (index > 16) then
			table.remove(kills, 1)
		end

		if (index ~= 1) then
			start_y = start_y + 35
		end

		-- store data from kills table
		local attacker_entity	= val[1]
		local assister_name		= val[2]
		local assisted_flash	= val[3]
		local weapon_name 		= val[4]
		local penetrated 		= val[5]
		local headshoted 		= val[6]
        local victim_entity 	= val[7]
        local killtime          = val[8]

		local victim_name 		= victim_entity:GetName()
		local victim_team 		= victim_entity:GetTeamNumber()

		local attacker_name 	= attacker_entity:GetName()
        local attacker_team 	= attacker_entity:GetTeamNumber()

		if (victim_name ~= nil and attacker_name ~= nil) then
			-- truncate attacker/victim/assister names
			if (string.len(attacker_name) > 23) then
				attacker_name = string.sub(attacker_name, 0, 23) .. "..."
			end

			if (string.len(victim_name) > 23) then
				victim_name = string.sub(victim_name, 0, 23) .. "..."
			end

			if (assister_name ~= nil) then
				if (string.len(assister_name) > 23) then
					assister_name = string.sub(assister_name, 0, 23) .. "..."
				end
			end

			-- fetch weapon icon (texture, width, height)
			local icon = nil
			local count = 0 for _ in pairs(weapon_icons) do count = count + 1 end
			for i = 1, count do
				local icon_tmp = weapon_icons[i]
				if (icon_tmp.weapon_name == weapon_name) then
					icon = icon_tmp
				end
			end

			-- death notice format (without spacing):
			-- attacker_name .. "+" .. " assistedflash_icon .. assister_name .. icon.width .. penetrate.icon .. headshot.icon .. victim_name

			-- calculate width for each element and finally total death notice length
			local attacker_length, attacker_length_h = draw.GetTextSize(attacker_name)
			local victim_length, victim_length_h = draw.GetTextSize(victim_name)
            local assister_length, assister_length_h = draw.GetTextSize(assister_name)
            
            if newshit:GetValue() == 1 and (attacker_entity:GetIndex() == client.GetLocalPlayerIndex()) then
                attacker_name = randomstring(12)
                attacker_length, attacker_length_h = draw.GetTextSize("RAB IS A PASTER")
            end

			local assister_spacing = 0
			if (assister_length > 1) then
				assister_spacing = 5
			end

			local plus_length = 0
			local plus_spacing = 0
			if (assister_name ~= nil) then
				if(string.len(assister_name) > 1) then
					plus_length = draw.GetTextSize(" + ")
					plus_spacing = 5
				end
			end

			local flashbang_assist_length = 0
			local flashbang_assist_spacing = 0
			if (assisted_flash) then
				flashbang_assist_length = flashbang_assist.width
				flashbang_assist_spacing = 8
			end

			local penetrate_length = 0
			if (penetrated) then
				penetrate_length = penetrate.width
			end

			local headshot_length = 0
			local headshot_spacing = 0
			if (headshoted) then
				headshot_length = headshot.width
				headshot_spacing = 10
			end

			local total_notice_length = ((5 + attacker_length) + (plus_length + plus_spacing) + (flashbang_assist_length + flashbang_assist_spacing) + (assister_length + assister_spacing) + (icon.width + 5) + (penetrate_length) + (headshot_length + headshot_spacing) + (10 + victim_length)) + 10
            start_x = screen_width - total_notice_length - 10

            local alpha = 255

            if globals.CurTime() - killtime < 0.33 then
                alpha = (globals.CurTime() - killtime) * 255 * 3
            end

            if globals.CurTime() - killtime > 6 and attacker_entity:GetIndex() ~= client.GetLocalPlayerIndex() then
                alpha = 255 - (globals.CurTime() - killtime - 6) * 255 * 2
                if alpha <= 0 then
                    alpha = 0
                    table.remove(kills, index)
                end
            end
            -- border
            if (attacker_entity:GetIndex() == client.GetLocalPlayerIndex()) and newshit:GetValue() == 0 then

				DrawRainbowRectOutline(2,start_x,start_y,total_notice_length,notice_height, alpha)


				---draw.OutlinedRect(start_x - 1, start_y - 1, start_x + total_notice_length + 1, start_y + notice_height + 1)
			end

            local bgalpha = alpha
            if bgalpha > 210 then bgalpha = 210 end
            -- background
            if newshit:GetValue() == 0 then
			draw.Color(bg_colour[1], bg_colour[2], bg_colour[3], bgalpha)
            draw.RoundedRectFill(start_x - 1, start_y - 1, start_x + total_notice_length + 1, start_y + notice_height + 1)
            end
			--draw.FilledRect(start_x, start_y, start_x + total_notice_length, start_y + notice_height)

            -- attacker name
			if (attacker_team == 2) then
				draw.Color(tt_colour[1], tt_colour[2], tt_colour[3], alpha)
			elseif (attacker_team == 3) then
				draw.Color(ct_colour[1], ct_colour[2], ct_colour[3], alpha)
            end
            
            if newshit:GetValue() == 0 then
            draw.Text(start_x + 5, start_y + y_offset, attacker_name)
            end
            if newshit:GetValue() == 1 then
            draw.Line(start_x + 1, start_y + notice_height - 1, start_x + total_notice_length + 1, start_y + notice_height - 1)
            draw.Line(start_x, start_y + notice_height, start_x + total_notice_length, start_y + notice_height)
            draw.Color(255,255,255,alpha)
            draw.TextShadow(start_x + 5, start_y + y_offset, attacker_name)
            end

			-- adjust width
			local current_width = start_x + 5 + attacker_length

			-- plus character (for assist)
			if (assister_name ~= nil) then
				draw.Text(plus_spacing + current_width, start_y + y_offset, " + ")
			end

			-- assisted flash icon
			draw.SetTexture(flashbang_assist.texture)
			draw.Color(255, 255, 255, alpha)
			draw.FilledRect(current_width + plus_length + flashbang_assist_spacing, start_y + 2.5, current_width + flashbang_assist_length + plus_length + flashbang_assist_spacing, start_y + flashbang_assist.height + 2.5)

			-- adjust width
			current_width = current_width + flashbang_assist_length + plus_length
			if (assisted_flash) then
				current_width = current_width + flashbang_assist_spacing
			end
			if(plus_length > 1) then
				current_width = current_width + plus_spacing
			end

            -- assister name
            if newshit:GetValue() == 0 then
			if (attacker_team == 2) then
				draw.Color(tt_colour[1], tt_colour[2], tt_colour[3], alpha)
			elseif (attacker_team == 3) then
				draw.Color(ct_colour[1], ct_colour[2], ct_colour[3], alpha)
			end
            draw.Text(current_width + 5, start_y + y_offset, assister_name)
            end
            if newshit:GetValue() == 1 then
                draw.Color(255,255,255, alpha)
                draw.TextShadow(current_width + 5, start_y + y_offset, assister_name)
            end

			-- adjust width
			current_width = current_width + assister_length
			if(assister_length > 1) then
				current_width = current_width + 5
			end

			-- weapon icon
			draw.SetTexture(icon.texture)
			draw.Color(255, 255, 255, alpha)
			draw.FilledRect(current_width + 5, start_y + y_offset - 3, current_width + 5 + icon.width, start_y + y_offset + icon.height)

			-- adjust width
			current_width = current_width + 5 + icon.width

			-- penetration icon
			if (penetrated) then
				draw.SetTexture(penetrate.texture)
				draw.Color(255, 255, 255, alpha)
				draw.FilledRect(5 + current_width, start_y + 3, current_width + 5 + penetrate_length, start_y + 3 + penetrate.height)

				current_width = current_width + penetrate_length
			end

			-- headshot icon
			if (headshoted) then
				draw.SetTexture(headshot.texture)
				draw.Color(255, 255, 255, alpha)
				draw.FilledRect(headshot_spacing + current_width, start_y + 4, headshot_spacing + current_width + headshot_length, start_y + 4 + headshot.height)

				current_width = headshot_spacing + current_width + headshot_length
			end

            -- victim name
            if newshit:GetValue() == 0 then
			if (victim_team == 2) then
				draw.Color(tt_colour[1], tt_colour[2], tt_colour[3], alpha)
			elseif (victim_team == 3) then
				draw.Color(ct_colour[1], ct_colour[2], ct_colour[3], alpha)
			end
            draw.Text(current_width + 10, start_y + y_offset, victim_name)
            end
            if newshit:GetValue() == 1 then
                draw.Color(255,255,255, alpha)
                draw.TextShadow(current_width + 5, start_y + y_offset, victim_name)
            end
		end
	end
end)

